import './App.css';
import Paginas from './components/Paginas';
import data from './db.json'

function App(props) {
  return (
    <div>
      {props.children}
      {data.map( pagina=>
         <Paginas 
            titulo = {pagina.cliente}
            url = {pagina.linkVideo}
            tareas = {pagina.preguntas}
            trans = {pagina.transcripcion}
         />)}

    </div>
  );
}

export default App;
